        return (
            <div className="footer">
                <span className="intro">
                <p>Create by React, NodeJS, MongoDB, Express, Antd</p>

                <a className="git" href="https://github.com/zemeigit"><GithubOutlined /></a>
                </span>
            </div>
        )
    }
}

export default Footer
